import React from 'react';

const InformationPage = () => {
  return (
    <div>
      <div style={topPortionStyles}>
        <div style={roundedBoxStyles}>Box 1</div>
        <div style={roundedBoxStyles}>Box 2</div>
        <div style={roundedBoxStyles}>Box 3</div>
        <div style={roundedBoxStyles}>Box 4</div>
      </div>

      <div style={formStyles}>
        <form>
          {/* Your form elements go here */}
          <label>
            Name:
            <input type="text" name="name" />
          </label>
          {/* Add more form elements as needed */}
          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

// Styles for the top portion (containing rounded boxes)
const topPortionStyles = {
  display: 'flex',
  justifyContent: 'space-around',
  alignItems: 'center',
  padding: '20px',
};

// Styles for individual rounded boxes
const roundedBoxStyles = {
  width: '100px',
  height: '100px',
  borderRadius: '10px',
  background: '#3498db', // Change the background color as needed
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  color: '#fff', // Change the text color as needed
};

// Styles for the form section
const formStyles = {
  padding: '20px',
};

export default InformationPage;
